fields.description:
Informa a modalidade da licitação.
- Concorrência;
- Tomada de preços;
- Convite; 
- Leilão;
- Pregão;
- Dispensa;
- Inexigibilidade;
- Registro de preços e etc.

Descrição do critério de julgamento utilizado no processo de compra: 
 - Por lote;
 - Por preço global;
 - Por item; 
 - Por maior desconto e
 - Por menor taxa de administração.
